import React from 'react';
import Navbar from "./components/Navbar/Navbar";
import './App.css';
import { Route, Router, Routes, BrowserRouter} from 'react-router-dom';
import Switch from "react-switch";
import Home from './Home'
import Food from './Food'








function App() {
  return (
       <div className='App'>

      <Router>
          <div>
            <Navbar />
            <Switch>
              <Route exactly component={Food} pattern="/" />
              <Route exactly component={Food} pattern="/path1" />
              <Route exactly component={Food} pattern="/path2" />
              <Route exactly component={Food} pattern="/path3" />
              <Route component={Food} />
            </Switch>
          </div>
        </Router>


        </div>

  );
}
export default App;
